import './LeftChatItem.css';
import React from 'react';


// function LeftChatItem({username, lastMessage, time}) {
function LeftChatItem({chat}) {

    return (
        <div className='left-chat-item row'>
            <div className=''>
            <h2 className="chat-member-name">{chat.currentUsername}</h2>
            <p className="chat-last-message">{chat.lastMessage}</p>
            <h5 className='last-message-time'>{chat.time} minutes ago</h5>
            </div>
        </div>
    );
}
export default LeftChatItem;
